    "2016-09-24T04:41:20.629786",nt"name": "3-year-recidivism-for-offenders-admitted-to-probation",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset reports whether an offender
    is re-admitted to prison or not within three years from their admission to probation.
     The recidivism reporting year is the fiscal year (year ending June 30) marking
    the end of the three year tracking period.  The Department of Corrections uses recidivism
    as an indicator on whether strategies are reducing offenders relapse into criminal
    behavior.  A three year time frame is used as studies have shown if an offender
    relapses into criminal behavior it is most likely to happen within three years.",nt"license_title":
